import React, { useState, useEffect } from "react";
import Sidebar from "../components/Sidebar";
import FileBrowser from "../components/FileBrowser";
import UploadModal from "../components/UploadModal";
import NewFolderModal from "../components/NewFolderModal";

export default function UserDashboard() {
  const [folders, setFolders] = useState(() => {
    const saved = localStorage.getItem("folders");
    return saved ? JSON.parse(saved) : [];
  });

  const [currentFolder, setCurrentFolder] = useState(null);
  const [showUpload, setShowUpload] = useState(false);
  const [showNewFolder, setShowNewFolder] = useState(false);
  const [search, setSearch] = useState("");

  // Persist folders
  useEffect(() => {
    localStorage.setItem("folders", JSON.stringify(folders));
  }, [folders]);

  // --- Create a new folder ---
  const handleCreateFolder = (name) => {
    if (!name.trim()) return alert("Folder name required!");
    const newFolder = { id: Date.now(), name, files: [] };
    setFolders((prev) => [...prev, newFolder]);
  };

  // --- Upload a file ---
  const handleUpload = (fileData) => {
  const fileUrl = URL.createObjectURL(fileData); // ✅ create a local preview URL
  const newFile = {
    id: Date.now(),
    name: fileData.name,
    size: `${(fileData.size / 1024).toFixed(1)} KB`,
    date: new Date().toISOString().split("T")[0],
    url: fileUrl, // ✅ store the URL
  };


    // Save inside current folder or root
    if (currentFolder) {
      setFolders((prev) =>
        prev.map((f) =>
          f.id === currentFolder.id
            ? { ...f, files: [...f.files, newFile] }
            : f
        )
      );
    } else {
      setFolders((prev) => {
        const root = prev.find((f) => f.name === "__ROOT__");
        if (root) {
          root.files.push(newFile);
          return [...prev];
        }
        return [...prev, { id: "root", name: "__ROOT__", files: [newFile] }];
      });
    }

    // --- Log upload history ---
    const history = JSON.parse(localStorage.getItem("history") || "[]");
    history.push({
      id: Date.now(),
      fileName: newFile.name,
      folder: currentFolder ? currentFolder.name : "Root",
      date: newFile.date,
    });
    localStorage.setItem("history", JSON.stringify(history));
  };

  // --- Folder navigation ---
  const handleOpenFolder = (folder) => {
    setCurrentFolder(folder);
  };

  const handleGoBack = () => {
    setCurrentFolder(null);
  };

  // --- Filter by search ---
  const filteredFolders = currentFolder
    ? currentFolder.files.filter((file) =>
        file.name.toLowerCase().includes(search.toLowerCase())
      )
    : folders.filter((f) =>
        f.name.toLowerCase().includes(search.toLowerCase())
      );

  return (
    <div className="flex min-h-screen bg-gray-50">
      {/* Sidebar navigation */}
      <Sidebar />

      {/* Main content */}
      <div className="flex-1 p-6">
        {/* Header & actions */}
        <div className="flex justify-between items-center mb-6">
          <div>
            <h1 className="text-2xl font-bold text-gray-800">
              {currentFolder ? currentFolder.name : "My Documents"}
            </h1>
            {currentFolder && (
              <button
                onClick={handleGoBack}
                className="text-blue-600 text-sm hover:underline mt-1"
              >
                ← Back to My Documents
              </button>
            )}
          </div>

          {/* Action bar */}
          <div className="flex items-center gap-3">
            <input
              type="text"
              placeholder="Search..."
              value={search}
              onChange={(e) => setSearch(e.target.value)}
              className="border border-gray-300 rounded-lg px-3 py-2 w-48"
            />
            <button
              onClick={() => setShowNewFolder(true)}
              className="bg-green-600 text-white px-4 py-2 rounded-lg hover:bg-green-700"
            >
              New Folder
            </button>
            <button
              onClick={() => setShowUpload(true)}
              className="bg-blue-600 text-white px-4 py-2 rounded-lg hover:bg-blue-700"
            >
              Upload
            </button>
          </div>
        </div>

        {/* File Browser */}
        <FileBrowser
          folders={currentFolder ? [] : filteredFolders}
          currentFolder={currentFolder}
          onOpenFolder={handleOpenFolder}
          searchQuery={search}
        />

        {/* Upload Modal */}
        {showUpload && (
          <UploadModal
            onClose={() => setShowUpload(false)}
            onUpload={handleUpload}
          />
        )}

        {/* New Folder Modal */}
        {showNewFolder && (
          <NewFolderModal
            onClose={() => setShowNewFolder(false)}
            onCreate={handleCreateFolder}
          />
        )}
      </div>
    </div>
  );
}
